import { StyleBar } from "./styles";

export default function Bar() {
  return (
    <StyleBar>
      <div>
        <span>Kenzie Health</span>
        <div>
          <span>Outubro rosa</span>
          <span>Sobre nós</span>
        </div>
      </div>
    </StyleBar>
  );
}
